import React from "react";

const HeroText = () => {
  return (
    <>
      <div className="bg-black flex flex-col items-center justify-center text-center h-screen">
        <h1 className="text-white text-4xl md:text-6xl font-bold">
          Make AI work for{" "}
          <span className="text-transparent bg-clip-text bg-gradient-to-r from-pink-500 to-blue-500">
            your brand
          </span>
        </h1>
        <h2 className="text-white text-2xl md:text-4xl font-medium mt-4">
          From Today
        </h2>
      </div>
      <div className="flex justify-center items-center">
        <a
          href="https://tally.so/r/mRPElv"
          target="_blank"
          rel="noopener noreferrer"
          className="relative inline-flex items-center justify-center px-6 py-3 rounded-full text-white text-lg font-medium bg-opacity-5 bg-white border-none transition-transform duration-300 transform hover:scale-105"
          style={{
            backgroundColor: "rgba(255, 255, 255, 0.05)",
          }}
        >
          <div
            className="absolute inset-0 rounded-full"
            style={{
              background:
                "radial-gradient(25% 45% at 60% 19%, #F3ADFF 0%, rgba(255, 255, 255, 0) 100%)",
              filter: "blur(15px)",
            }}
          ></div>
          <div
            className="absolute inset-0 rounded-full"
            style={{
              background:
                "radial-gradient(19% 47% at 60% 19%, #FC6EFF 0%, rgba(255, 255, 255, 0) 100%)",
            }}
          ></div>
          <div
            className="absolute inset-0 rounded-full"
            style={{
              backgroundColor: "rgb(0, 0, 0)",
            }}
          ></div>
          <span className="relative z-10">Join Waitlist</span>
        </a>
      </div>
      <div className="bg-black flex justify-center items-center h-screen">
        <button className="relative bg-black text-white text-lg font-semibold py-3 px-8 rounded-full border border-gray-700 shadow-md hover:shadow-lg transition">
          Join Waitlist
          <span className="absolute inset-x-0 bottom-0 h-2 bg-gradient-to-r from-purple-500 to-pink-500 rounded-full opacity-50 blur-md"></span>
        </button>
      </div>
      <div className="relative w-full h-full">
        <video
          src="https://framerusercontent.com/assets/wRohANpz9aHkFTX69NtufAoCyVE.mp4"
          loop
          playsInline
          autoPlay
          muted
          className="w-full h-full object-cover bg-black"
          style={{
            cursor: "auto",
            borderRadius: "0px",
            backgroundColor: "rgba(0, 0, 0, 0)",
            objectPosition: "50% 50%",
          }}
        ></video>
      </div>
    </>
  );
};

export default HeroText;
